import React from "react";

function Home() {

    const style = {
        background: "url(" + require("../img/background.jpg") + ")"
    }

  return (
    <>
          <div className="fullPage" style={style}>
        <div className="banner">
          <h1>Bine ai venit la tresure hunt-ul organizat de Thobor</h1>
        </div>
        <div className="obtiuni">
          <div className="start">
            <h2>Start</h2>
          </div>
          <div className="instructiuni">
            <h2>instructiuni</h2>
          </div>
        </div>
      </div>
    </>
  );
}

export default Home;
